() => {
  // Look for common menu triggers and navigation elements
  const menuSelectors = [
    'button[aria-label*="menu"]',
    'button[aria-expanded]', 
    '[role="menubutton"]',
    '.menu-toggle',
    '.hamburger',
    'nav button',
    '[data-menu]',
    '.nav-trigger'
  ];

  const results = [];

  menuSelectors.forEach(selector => {
    const elements = document.querySelectorAll(selector);
    elements.forEach((el, i) => {
      results.push({
        selector: selector,
        index: i,
        text: el.textContent?.trim() || '',
        visible: window.getComputedStyle(el).display !== 'none' && window.getComputedStyle(el).visibility !== 'hidden',
        attributes: Array.from(el.attributes).map(attr => `${attr.name}="${attr.value}"`).join(' ')
      });
    });
  });

  // Also look for existing navigation links
  const navLinks = Array.from(document.querySelectorAll('nav a, .nav a, [role="navigation"] a')).map(link => ({
    text: link.textContent?.trim(),
    href: link.href,
    visible: window.getComputedStyle(link).display !== 'none'
  }));

  return {
    menuTriggers: results,
    existingNavLinks: navLinks.slice(0, 20), // Limit to first 20
    bodyClasses: document.body.className,
    hasNavElements: document.querySelectorAll('nav').length > 0
  };
}

