() => {
  // Look for all links that might be navigation/category links
  const allLinks = Array.from(document.querySelectorAll('a[href*="/collections"], a[href*="/categories"], a[href*="/shop"], footer a, nav a'));

  const categoryLinks = [];
  const otherLinks = [];

  allLinks.forEach(link => {
    const text = link.textContent?.trim();
    const href = link.href;
    const isVisible = window.getComputedStyle(link).display !== 'none' && window.getComputedStyle(link).visibility !== 'hidden';

    if (text && href && isVisible) {
      const linkInfo = { name: text, url: href };

      if (href.includes('/collections') || href.includes('/categories')) {
        categoryLinks.push(linkInfo);
      } else {
        otherLinks.push(linkInfo);
      }
    }
  });

  // Check if there are any elements that might expand to show more navigation
  const potentialExpandableElements = Array.from(document.querySelectorAll('button, [data-toggle], [aria-expanded="false"]')).map(el => ({
    tag: el.tagName,
    text: el.textContent?.trim(),
    classes: el.className,
    attributes: Array.from(el.attributes).map(attr => `${attr.name}="${attr.value}"`).join(' ')
  }));

  return {
    categoryLinks: categoryLinks,
    otherNavLinks: otherLinks.slice(0, 10),
    potentialExpandableElements: potentialExpandableElements.slice(0, 10)
  };
}

