() => {
  // Extract the main category navigation links from the collections page
  const categoryLinks = [];

  // Look for the category links at the top of the main content area
  const mainCategoryLinks = document.querySelectorAll('main a[href*="/collections/"]');

  mainCategoryLinks.forEach(link => {
    const text = link.textContent?.trim();
    const href = link.href;

    // Skip product links (they have longer paths) and only get category links
    if (text && href && href.match(/\/collections\/[^\/]+$/) && !href.includes('?')) {
      categoryLinks.push({
        name: text,
        url: href,
        children: []
      });
    }
  });

  // Remove duplicates based on URL
  const uniqueCategories = [];
  const seenUrls = new Set();

  categoryLinks.forEach(category => {
    if (!seenUrls.has(category.url)) {
      seenUrls.add(category.url);
      uniqueCategories.push(category);
    }
  });

  return uniqueCategories;
}

