function extractNavigation() {
  const results = [];

  // Get all collection links within main
  const links = document.querySelectorAll('main a[href*="/collections/"]');

  for (let i = 0; i < links.length; i++) {
    const link = links[i];
    const name = link.textContent?.trim();
    const url = link.href;

    if (name && url && !url.includes('?') && !url.includes('/products/')) {
      results.push({
        name: name,
        url: url,
        children: []
      });
    }
  }

  // Basic deduplication
  const unique = [];
  const seen = {};

  for (let i = 0; i < results.length; i++) {
    const item = results[i];
    if (!seen[item.url]) {
      seen[item.url] = true;
      unique.push(item);
    }
  }

  return unique;
}

